import '../App.css';
import React, { useState } from "react";

function Reports() {
    const [photo, setPhoto] = useState("");

    return  (
        <div className="Reports">
            <div className="head">
                <div className="title">
                    Reports
                </div>
                <div className="download-button" onclick="">
                    <i class="fa-solid fa-download"/>
                    <div className="download">Download</div>
                </div>
            </div>
            <hr width="" color="#E5E5E5"/>
            <div>
                <div className="left">
                    <div className="photo">
                        <img src={photo}/>
                    </div>
                </div>
                <div className="right">
                    오른쪽 부분 - 지도, 그 외 속성들
                </div>
            </div>
        </div>
    );
}

export default Reports;
